import React from 'react';
import './Product.css';

app.get('/products', async (req, res) => {

  const imag = await Product.image.find()
    
  res.json({
      data: products
  })
})

function Product({header, image, price}) {
  return (
    <div className="Product">
      <img src={image} />
      <h1>{header}</h1>
      <p>{` ${price} руб. `}</p>
      <button>В корзину</button>
    </div>
  );
}

export default Product;
